// Site-specific JavaScript

(function( root, $, undefined ) {
    "use strict";

    $(function () {

        $('#masthead').imagesLoaded({ background: true }, function() {
            // images have loaded
            $('body').addClass('masthead-loaded');
        });

    	$('#to-top').on('click', function(e) {
    		$('html, body').animate({scrollTop: $("#top").offset().top}, 1000);
    		e.preventDefault();
    	});

        $('.page-links a').on('click', function(e) {
            $('html, body').animate({scrollTop: $(this.hash).offset().top}, 1000);
            e.preventDefault();
        });

        $('#nav-trigger').on('click', function(e) {
            $('body').addClass('overlay-active');
        });

        $('#overlay-close').on('click', function(e) {
            $('body').removeClass('overlay-active');
        });

    	$('.acc-header').on('click', function(e) {
    		var $accSegment = $(this).parent('.acc-segment');
    		if ($accSegment.hasClass('active')) {
    			$accSegment.children('.acc-contents').slideUp(function() {
    				$accSegment.removeClass('active');
    			});
    		}
    		else {
    			$accSegment.children('.acc-contents').slideDown(function() {
    				$accSegment.addClass('active');
    			});
    			
    		}
    	});

        $(window).on('load', function() {

            var quickHash = window.location.hash;
            if ($(quickHash).length === 1) {
                $('html, body').animate({scrollTop: $(quickHash).offset().top}, 1000);
                $(quickHash).children('.acc-contents').slideDown(function() {
                    $(quickHash).addClass('active');
                });
            }

            $('#bios-slider').flexslider({
                animation: 'slide',
                directionNav: false,
                manualControls: '#control-panel span',
                slideshow: false,
                smoothHeight: true
            });
            $('#masthead-body-slider').flexslider({
                animation: 'fade',
                directionNav: false,
                slideshow: true
            });
        });
        
    });

} ( this, jQuery ));
